  RefElement.EdgeNodesElem=EdgeNodes;
  RefElement.NodesCoordElem=X3D;
  RefElement.NodesCoordFace=X2D;
  RefElement.NodesCoordEdge=X1D;
  RefElement.GaussCoordinatesElem=Xg3D;
  RefElement.GaussCoordinatesFace=Xg2D;
  RefElement.GaussCoordinatesEdge=Xg1D;
  RefElement.GaussWeigthsElem=Gw3D;
  RefElement.GaussWeigthsFace=Gw2D;
  RefElement.GaussWeigthsEdge=Gw1D;
  RefElement.ShapeFunctionsElem=N3D;
  RefElement.ShapeFunctionsFace=N2D;
  RefElement.ShapeFunctionsEdge=N1D;
  RefElement.ShapeFunctionDerivativesElemXi=N3DXi;
  RefElement.ShapeFunctionDerivativesElemEta=N3DEta;
  RefElement.ShapeFunctionDerivativesElemZeta=N3DZeta;
  RefElement.ShapeFunctionDerivativesFaceXi=N2DXi;
  RefElement.ShapeFunctionDerivativesFaceEta=N2DEta;
  RefElement.ShapeFunctionDerivativesEdgeXi=N1DXi;
  RefElement.PseudoinverseShapeFunctionsElem=pinv(N3D);
  RefElement.PseudoinverseShapeFunctionsFace=pinv(N2D);
  RefElement.PseudoinverseShapeFunctionsEdge=pinv(N1D);
end

